import "../../App.css";
import * as React from "react";
import ArrowCircleDownIcon from '@mui/icons-material/ArrowCircleDown';


class Widget6 extends React.Component {

    render() {

        return (
            <div className="graphcard">Genre/Age des visiteurs
            <div classe="skills">
                <p>COMPETENCES</p>
                <li>
                    <p>Programmation</p>
                    <span class="bar"><span class="programmation"></span></span>
                </li>
                <li>
                    <p>Base de donnees</p>
                    <span class="bar"><span class="bdd"></span></span>
                </li>
                <li>
                    <p>Pack Office</p>
                    <span class="bar"><span class="office"></span></span>
                </li>
                <li>
                    <p>Anglais</p>
                    <span class="bar"><span class="anglais"></span></span>
                </li>
                <li>
                    <p>Allemand</p>
                    <span class="bar"><span class="allemand"></span></span>
                </li>


            </div>
            </div>


        );
    }
}

export default Widget6;
